import { Grid } from "@mui/material";
import BedOutlinedIcon from '@mui/icons-material/BedOutlined';
export default function(){
    return(
        <Grid>
            <div>
            <div style={{textAlign:"start"}}>
                <h2>Discover Our Featured Listing</h2>
                <div style={{display:"flex", justifyContent:"space-between"}}>
                <p>Aliquam lacinia diam quis lacus euismod</p>
                <h3>See All Properties</h3>
                </div>
            </div>
            <div
              elevation={3}
              style={{
                width: "100%",
                display: "flex",
                justifyContent: "space-around",
                borderRadius: 5,
              }}
            >
              <div>
                <paper>
                  {" "}
                  <img src="1.png" style={{ width: "90%" }} />
                </paper>{" "}
                <p>House on the Hollywood</p>
                <p style={{color:"gray"}}>374 Johnson Ave</p>
                <div>
                    <div>
                        <BedOutlinedIcon/>
                        <p>6 beds</p>
                    </div>
                </div>
              </div>
              <div>
                {" "}
                <img src="2.png" style={{ width: "90%" }} />{" "}
                <p>Comfortable Villa Green</p>
                <p
                  style={{
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "space-around",
                  }}
                >
                  $4,600<p>__6 ...2 .._200</p>
                </p>
              </div>
              <div>
                {" "}
                <img src="3.png" style={{ width: "90%" }} />{" "}
                <p>Quality House For Sale</p>
                <p
                  style={{
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "space-around",
                  }}
                >
                  $4,600<p>__6 ...2 .._200</p>
                </p>
              </div>
              <div>
                {" "}
                <img src="4.png" style={{ width: "90%" }} />{" "}
                <p>Diamond Family Home</p>
                <p
                  style={{
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "space-around",
                  }}
                >
                  $4,600<p>__6 ...2 .._200</p>
                </p>
              </div>
            </div>
            </div>
        </Grid>
    )
}
